const INITIAL_STATE = {
    menuSection: [ 
        {
        'Id': 1,
        'Title':'Fashion',
        'Link':'/Fashion',
        'Items':[{id:1,Title:'Jackets',Link:'/Jacket'},{id:2,Title:'Shoes',Link:'/Shoes'},{id:3,Title:'Dress',Link:'/Dress'},{id:4,Title:'Makeup',Link:'/Makeup'}]
        },
        {
        'Id': 2,
        'Title':'Health And Fitness',
        'Link':'/Health And Fitness',
        'Items':[{id:1,Title:'Supplement',Link:'/Supplements'},{id:2,Title:'Nootropics',Link:'/Nootropics'}]
        }
        
        ]

     ,
     toggleMenu:false   
        
  };
  
  const menuReducer = (state = INITIAL_STATE, action) => {
    switch (action.type) {
      case "DISPLAY_DIRECTORY":
        return {
          state,
        };
  
      default:
        return state;
    }
  };
  
  export default menuReducer;
